import axios from "axios";
import { useEffect } from "react";
const TestnetGetAccountAPI = props => {
    const { response } = props;
    useEffect(()=>{
        axios.get(`https://horizon-testnet.stellar.org/accounts/GD6GNQ2L4KAQU4IT7VTJFPSFTRF5XUCOBISZ3USU36PEAKWUHBFAY2TG`)
            .then(res=>{
                response(res.data.balances)
                console.log(res.data)})
            .catch(err=>{console.log(err)})
    },[])
    return null
}
export default TestnetGetAccountAPI;
